import React from "react";
import "../styles/App.css";
import TableHead from '../components/TableHead'
// import TableCell from '../components/TableCell'

const Table = () => {
  return (
    <div className="table-container">
      <TableHead content={{ id: 1, name: "Дата" }} />
      <TableHead content={{ id: 2, name: "Название" }} />
      <TableHead content={{ id: 3, name: "Количество" }} />
      <TableHead content={{ id: 4, name: "Расстояние" }} />
      {/* <TableCell />
      <TableCell />
      <TableCell />
      <TableCell /> */}
    </div>
  );
};

export default Table;
